import{_ as s,a as t,o as a,L as r}from"./chunks/framework.CKEhg_8n.js";const e="/assets/IMG_1761.mRJf4u7I.jpg",o="/assets/IMG_1741.wXOZbnsY.jpg",_="/assets/IMG_1748.DhU6oioY.jpg",p="/assets/IMG_1757.CYc8Jtz-.jpg",c="/assets/IMG_1743.CNmLUmZY.jpg",i="/assets/IMG_1767.CtLXPwPq.jpg",l="/assets/IMG_1768.B2_i0PUB.jpg",n="/assets/IMG_1769.Do2ay4b6.jpg",m="/assets/IMG_1770.DBQGYS3f.jpg",g="/assets/IMG_1771.Cy7SqaFi.jpg",j="/assets/ZcZ8QILlMgc.D3za40_4.jpg",I="/assets/1HPlj8PSjig.CgTPX1X2.jpg",h="/assets/4xNX7uWeazQ.C_Uq_oV6.jpg",f="/assets/7psigj4wGg0.Cp0WKHuI.jpg",k="/assets/H4yG9yEWeb4.DIDxVCoq.jpg",G="/assets/IMG_1772.B9y6o-qB.jpg",M="/assets/IMG_1773.CJmENGKI.jpg",d="/assets/IMG_1778.CIEUSUbV.jpg",u="/assets/IMG_1781.CtNk-SzA.jpg",C="/assets/IMG_1782.wa7CKlrV.jpg",x="/assets/IMG_1783.BuOVtFO9.jpg",b="/assets/IMG_1784.CS-daKoE.jpg",y="/assets/IMG_1791.CVY1vKUF.jpg",w="/assets/IMG_1794.jpK11ku9.jpg",D="/assets/IMG_1796.e28Em7wY.jpg",P="/assets/IMG_1797.DSXLNGht.jpg",S="/assets/oxAWVfvQLGU.Pz2aFC6m.jpg",q="/assets/8-y6yqK4X1Y.CP1Ki4X1.jpg",v="/assets/IMG_1802.BggrpZKd.jpg",N="/assets/IMG_1804.XkcS6ZUO.jpg",V="/assets/IMG_1806.CylmNQLo.jpg",B="/assets/IMG_1785.2HTxgk0h.jpg",Q=JSON.parse('{"title":"Столярный цех на Фабрике на Даниловском рынке","description":"","frontmatter":{"title":"Столярный цех на Фабрике на Даниловском рынке","date":"2015-08-17","cover":"IMG_1762.jpg"},"headers":[],"relativePath":"practice/ooley42/danilovskiy/index.md","filePath":"practice/ooley42/danilovskiy/index.md"}'),K={name:"practice/ooley42/danilovskiy/index.md"},L=r('<p><img src="'+e+'" alt=""><img src="'+o+'" alt=""><img src="'+_+'" alt=""><img src="'+p+'" alt=""><img src="'+c+'" alt=""></p><p>15 августа на один субботний день на Даниловском рынке Москвы возникла Фабрика ручного труда, где каждый желающий мог поработать в любом из её цехов и сделать какой-нибудь предмет быта своими руками. Такое неожиданное преображение рынка стало возможно благодаря его сотрудничеству с командой <a href="http://theoryandpractice.ru/" class="external-link" target="_blank" rel="noreferrer">портала «Теории и практики»</a>.</p><p><img src="'+i+'" alt=""><img src="'+l+'" alt=""><img src="'+n+'" alt=""><img src="'+m+'" alt=""><img src="'+g+'" alt=""></p><p>Фабрика состояла из 6 разнонаправленных цехов. Каждый желающий при входе на рынок мог приобрести за 300 рублей билет, позволяющий поработать в одном из цехов и получить вещь, сделанную своими руками. В вязальном цехе мастерицы из <a href="http://craftslab.ru/" class="external-link" target="_blank" rel="noreferrer">Craft Lab</a> обучали изготовлению трикотажных ковриков. <a href="https://www.facebook.com/panikapost" class="external-link" target="_blank" rel="noreferrer">Panika Derevya</a> помогала сшить и ракрасить наволочку для интерьерной подушки в швейном цехе. <a href="https://www.facebook.com/DashDashCosmetics" class="external-link" target="_blank" rel="noreferrer">Dash_Dash Natural Cosmetics</a> предоставили десятки особенных ингредиентов для создания неповторимого крема-мусса. <a href="http://monolama.ru/" class="external-link" target="_blank" rel="noreferrer">Студия Monolama</a> подготовила множество деталей для создания значков из оргстекла в конструкторском цехе. <a href="https://vk.com/o_horosho" class="external-link" target="_blank" rel="noreferrer">Сервис &quot;Очень хорошо&quot;</a> делился навыками создания букетов из овощей в цветочном цехе. А в столярном цехе <a href="https://www.facebook.com/rukiottuda" class="external-link" target="_blank" rel="noreferrer">мастерская &quot;Рукиоттуда&quot;</a> благотворительного <a href="http://vverh.su/" class="external-link" target="_blank" rel="noreferrer">центра &quot;Вверх&quot;</a> при поддержке команды OOLEY дала возможность каждому желающему самостоятельно изготовить разделочную доску авторского дизайна.</p><p><img src="'+j+'" alt=""></p><p><img src="'+I+'" alt=""><img src="'+h+'" alt=""><img src="'+f+'" alt=""></p><p><img src="'+k+'" alt=""></p><p><img src="'+G+'" alt=""><img src="'+M+'" alt=""><img src="'+d+'" alt=""><img src="'+u+'" alt=""><img src="'+C+'" alt=""><img src="'+x+'" alt=""><img src="'+b+'" alt=""></p><p><img src="'+y+'" alt=""><img src="'+w+'" alt=""><img src="'+D+'" alt=""><img src="'+P+'" alt=""><img src="'+S+'" alt=""></p><p>Начав принимать участников в 14:00, Фабрика сразу загрузила свои мощности и всего за 4 часа работы дала возможность творческого самовыражения более ста участникам. В одном только столярном цеху посетители рынка смогли произвести более двадцати уникальных разделочных досок. Самостоятельно разработанную форму доски участники цеха сами вырезали из букового щита электролобзиком. Тщательно ошлифовав поверхности наждачной бумагой и нанеся рисунки выжигательным аппаратом, гости Фабрики покрыли изделия специальным маслом.</p><p>Две диковинных рыбы, знак Бетмена, кит, виолончель, гитара, два Питера Гриффина, тесак, овал и различные абстрактные формы — участники цеха нашли выход своей фантазии и сделали разделочные доски настоящим средством самовыражения. Затратив в среднем около полутора-двух часов на работу, каждый из них получил не только уникальный предмет быта, но и удовольствие самостоятельного творчества, а также ценные навыки, которые могут пригодиться во многих жизненных ситуациях.</p><p><img src="'+q+'" alt=""><img src="'+v+'" alt=""><img src="'+N+'" alt=""><img src="'+V+'" alt=""><img src="'+B+'" alt=""></p>',12),U=[L];function X(Y,E,T,O,Z,z){return a(),t("div",null,U)}const F=s(K,[["render",X]]);export{Q as __pageData,F as default};
